import React from 'react';
import '../Footer/Footer.css';
import FooterLogo from '../../images/footer-logo.png';
import linkedIn from '../../images/linkedIn.png';
import facebook from '../../images/facebook.png';
import instagram from '../../images/instagram.png';

const Footer = () => {
  return (
    <div className='footer'>
        <a href="/"></a><img id='footer-logo' src={FooterLogo} alt="linkedIn" />
        <a href=""></a><img id='facebook' src={facebook} alt="facebook" />
        <a href="https://www.linkedin.com/company/kaash/"><img id='linkedIn' src={linkedIn} alt="linkedIn" /></a>
        <a href=""></a><img id='instagram' src={instagram} alt="instagram" />
    </div>
  )
}

export default Footer;
